import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

class FindAllAnagramsInaStringTest {
    FindAllAnagramsInaString findAllAnagramsInaString = new FindAllAnagramsInaString();

    @Test
    void findAnagrams() {
        String first = "abcacbca";
        String second = "abc";
        int[] result = {0,1,3,5};
        int[] actual = findAllAnagramsInaString.findAnagrams(first, second).stream().mapToInt(Integer::intValue).toArray();
        Assertions.assertArrayEquals(result, actual);
    }

    @Test
    void findAnagrams2() {
        String first = "abcacbca";
        String second = "a";
        int[] result = {0,3,7};
        int[] actual = findAllAnagramsInaString.findAnagrams(first, second).stream().mapToInt(Integer::intValue).toArray();
        Assertions.assertArrayEquals(result, actual);
    }

    @Test
    void findAnagrams3() {
        String first = "abcacbca";
        String second = "ac";
        int[] result = {2,3,6};
        int[] actual = findAllAnagramsInaString.findAnagrams(first, second).stream().mapToInt(Integer::intValue).toArray();
        Assertions.assertArrayEquals(result, actual);
    }

    @Test
    void findAnagrams4() {
        String first = "";
        String second ="";
        int[] result = {0,10001};
        int[] actual = findAllAnagramsInaString.findAnagrams(first, second).stream().mapToInt(Integer::intValue).toArray();
        Assertions.assertArrayEquals(result, actual);
    }
}